script: |
  super -f text -I q670.spq | sort > q670.out

inputs:
  - name: q670.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE - 83 NOT BETWEEN - + col2 AND ( + - col2 ) / + col0 / - 14;
  - name: tab0

outputs:
  - name: q670.out
    data: |
      15	81	47
      87	21	10
